import React from "react";
import './aboutMe.css';

function AboutMe(){
    return(
        <div className="about-div">
            <div id="aboutMe">
                <div className="contenedor-1">
                    <p className="text-about-me"> Hola, me llamo <strong className="strong">Joaquin</strong>, tengo 20 años y nací en Rosario/SantaFe/Argentina
                    </p>
                </div>
            </div>
        </div>
    );
}


export default AboutMe;
